import React from 'react';
import Tilt from 'react-vanilla-tilt';

const TiltBox = () => {
	return (
		<Tilt className='brainCard'>
			<div className = 'subCard'>
				<img src={require('./brain.svg')} alt='brain' className="mw2"/>
			</div>
		</Tilt>
		)
}

export default TiltBox;
